import React, {Component} from 'react';
import classes from './Dialogs.module.css';
import {NavLink} from "react-router-dom"


const Dialog = (props) => {

    let Path = "/dialogs/" + props.id;

    return <div className={classes.dialog + ' ' + classes.active}>
        <NavLink to={Path} className={classes.link}>{props.name}</NavLink>
    </div>
};

const Message = (props) => {
    return <div className={classes.message}>{props.message}</div>
};


const Dialogs = (props) => {

    let dialogsData = [
        {id: 1, name: 'Sasha'},
        {id: 2, name: 'Kolechka'},
        {id: 3, name: 'Andrey'},
        {id: 4, name: 'Chekatilo'},
        {id: 5, name: 'Vorobey'}
    ]

    let dialogsElements = dialogsData
        .map( dialog => <Dialog name={dialogsData.name} id={dialogsData.id}/>)

    let messagesData = [
        {id: 1, message: 'Hi!'},
        {id: 2, message: 'Byhai'},
        {id: 3, message: 'How is your wife?'},
    ]

    let messagesElements = messagesData
        .map(message => <Message message={messagesData.message}/>)

    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <Dialog name={dialogsData[0].name} id={dialogsData[0].id}/>
                <Dialog name={dialogsData[1].name} id={dialogsData[1].id}/>
                <Dialog name="Andrey" id="3"/>
                <Dialog name="Chekatilo" id="4"/>
                <Dialog name="Vorobey" id="5"/>
            </div>
            <div className={classes.messages}>
                <Message message={messagesData[0].message}/>
                <Message message={messagesData[1].message}/>
                <Message message={messagesData[2].message}/>
            </div>
        </div>
    )
};

export default Dialogs;
